import React from 'react'
import styled from "styled-components";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";


const Holding = () => {
    const Holdingsection = styled.section`
    
    `;

    function createData(stock: string, qty: number, avg: number,ltp:Number,) {
        return { large, mid, small };
      }
    
      const rows = [
        createData("Reliance","ABCAPITAL", "AEGIS LOGISTICS"),
        createData("TCS", "LUPIN", "COFORGE"),
        createData("HDFC Bank", "MAXHEALTH", "DEEPAK NITRITE"),
        createData("Infosys", "GODREJIND", "KAJARIA CERAMICS"),
        createData("ICICI Bank", "JINDALSTEL", "METROPOLIS HEALTHCARE")
      ];

  return (
    <Holdingsection>
        <TableContainer className="tableContainer" component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell>Stocks</TableCell>
                  <TableCell align="right">Qty</TableCell>
                  <TableCell align="right">Avg cost</TableCell>
                  <TableCell align="right">LTP</TableCell>
                  <TableCell align="right">Cur. val</TableCell>
                  <TableCell align="right">P&L</TableCell>
                  <TableCell align="right">Net chg</TableCell>
                  <TableCell align="right">Day chg</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row) => (
                  <TableRow
                    key={row.name}
                    sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                  >
                    <TableCell  scope="row">
                      {row.large}
                    </TableCell>
                    <TableCell align="right">{row.mid}</TableCell>
                    <TableCell align="right">{row.small}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
    </Holdingsection>
  )
}

export default Holding
